(4, 'DEBAT KANDIDAT CALON KETUA IKAPUNIJA', 'JAKARTA - Ikatan Alumni Politeknik UI/Negeri Jakarta atau biasa disebut Ikapunija melakukan kegatan Debat Kandidat serta Penyampaian Visi dan Misi', 'X5yZn8FvUXUmeYKb-2021-02-18-agenda-2bb1c82a9bcdcb8e8b275fc983fd8c36.jpg', '<p style=\"text-align: justify; \">JAKARTA - Ikatan Alumni Politeknik UI/Negeri Jakarta atau biasa disebut Ikapunija melakukan kegiatan Debat Kandidat serta Penyampaian Visi dan Misi Calon Ketua Ikapunija, dan Calon Anggota Dewan Perwakilan Alumni (DPA). (13/2)</p><p style=\"text-align: justify;\">Kegiatan ini dihadiri oleh Pengurus Ikapunija, para Alumni Politeknik Universitas Indonesia, Alumni Politeknik Negeri Jakarta serta calon Ketua Ikapunija dan Calon Anggota DPA.</p><p style=\"text-align: justify; \">Agenda ini merupakan serangkaian dari proses regenerasi Pengurus Ikapunija dan Anggota DPA, dan diharapkan akan terlahir pengurus-pengurus baru yang dapat memberikan kontribusi terbaiknya untuk dapat memajukan Ikapunija.</p>', 15, 1, '2021-02-18 13:24:57', 'N', '2021-02-18 13:24:57', '2021-02-27 13:15:58'),
