(10, 'DEBAT KANDIDAT CALON KETUA IKAPUNIJA', 'JAKARTA - Ikatan Alumni Politeknik UI/Negeri Jakarta atau biasa disebut Ikapunija melakukan kegatan Debat Kandidat serta Penyampaian Visi dan Misi Calon Ketua Ikapunija', 'BSAxMzlmhrHFBCq4-2021-02-18-agenda-2bb1c82a9bcdcb8e8b275fc983fd8c36.jpg', '<p>JAKARTA - Ikatan Alumni Politeknik UI/Negeri Jakarta atau biasa disebut Ikapunija melakukan kegatan Debat Kandidat serta Penyampaian Visi dan Misi Calon Ketua Ikapunija, dan Calon Anggota Dewan Perwakilan Alumni (DPA). (13/2)</p><p>Kegiatan ini dihadiri oleh Pengurus Ikapunija, para Alumni Politeknik Universitas Indonesia, Alumni Politeknik Negeri Jakarta serta calon Ketua Ikapunija dan Calon Anggota DPA.</p><p>Agenda ini merupakan serangkaian dari proses regenerasi Pengurus Ikapunija dan DPA , diharapkan akan terlahir pengurus-pengurus baru yang dapat memberikan kontribusi terbaiknya untuk dapat memajukan Ikapunija.</p>', 15, 1, '2021-02-18 13:25:50', 'N', '2021-02-18 13:25:50', '2021-02-18 13:26:57'),
(11, 'Rapat Anggota Tahunan 2021', 'Rapat Anggota Tahunan  KOPTEK 2021', 'a17bnZN1CxeVgfmD-2021-02-24-agenda-82767a9ba437dc84f2275475477d727b.jpg', '<p>Live at Zoom and Youtube</p>', 11, 1, '2021-02-24 04:02:51', 'Y', '2021-02-24 04:02:51', '2021-02-24 04:02:51'),
(12, 'Berita Online - Terpilihnya Ketua Umum Ikapunija', 'Terpilih Jadi Ketum Ikapunija, Chairuddin Akan Himpun Kekuatan Alumni', '7CebU9xu466A1tg2-2021-02-27-agenda-04ed3e9d8c1a596b08229a2207198f76.jpg', '<div class=\"news_part_1 wow fadeIn\" style=\"outline: none; animation-name: fadeIn; font-family: montserrat, sans-serif; margin: 20px 0px; color: rgb(51, 51, 51); visibility: visible;\"><img class=\"content_ico\" src=\"https://dashboard.rmol.id/assets/images/logo/07461304122020_15x.png\" style=\"outline: none; border: 0px;\">&nbsp;Ikatan Alumni Politeknik Universitas Indonesia dan Alumni Politeknik Negeri Jakarta yang disingkat Ikapunija, sukses menggelar Rapat Umum Anggota Ikapunija pada beberapa hari lalu.</div><div class=\"news_part_1 wow fadeIn\" style=\"outline: none; animation-name: fadeIn; font-family: montserrat, sans-serif; margin: 20px 0px; color: rgb(51, 51, 51); visibility: visible;\"><span style=\"font-size: 1rem;\">Organisasi yang dibentuk pada 22 Mei 2010 ini merupakan wadah yang menghimpun alumni Politeknik Universitas Indonesia dan Politeknik Negeri Jakarta dari tahun 1982 sampai dengan 2017.</span></div><div class=\"news_part_1 wow fadeIn\" style=\"outline: none; animation-name: fadeIn; font-family: montserrat, sans-serif; margin: 20px 0px; color: rgb(51, 51, 51); visibility: visible;\"><span style=\"font-size: 1rem;\"><br></span><span style=\"font-size: 1rem;\">\"Alhamdulillah Rapat Umum Anggota Ikapunija berjalan cukup baik dengan suasana kekeluargaan yang tinggi,\" kata Revli selaku Ketua Stearing Committee dalam keterangan tertulis, Sabtu (27/2).</span></div><div class=\"news_part_1 wow fadeIn\" style=\"outline: none; animation-name: fadeIn; font-family: montserrat, sans-serif; margin: 20px 0px; color: rgb(51, 51, 51); visibility: visible;\">Dalam rapat terpilih secara aklamasi, Chairuddin dari Teknik Elektro 91 sebagai ketua umum, setelah sebelumnya Rakhmansyah dari Perbankan 99 mengundurkan diri dan menyatakan dukungannya kepada bang Chairuddin.<br style=\"outline: none;\"><br style=\"outline: none;\">Disamping itu, dalam rapat itu dipilih enam orang Dewan Perwakilan Alumni, yaitu M. Zahir SA (1983), Unggul Baroto (1982), Agus Kristiyanto (1990), Rian Subakti (1999), Fitroh Haris (2006), dan M Rafi (2013). Sedangkan Perwakilan dari Politeknik Negeri Jakarta adalah Iwan Supriyadi (Wakil Direktur IV).<br style=\"outline: none;\"><br style=\"outline: none;\">Kesempatan terpisah, Ketua Umum terpilih Ikapunija, Chairuddin menjelaskan konsep utama yang akan diterapkan ke depan adalah connection the dot.</div><div class=\"news_part_1 wow fadeIn\" style=\"outline: none; animation-name: fadeIn; font-family: montserrat, sans-serif; margin: 20px 0px; color: rgb(51, 51, 51); visibility: visible;\">\"Bagaimana kita dapat menghubungkan antar alumni, agar semua saling kolaborasi dalam berbagai tujuan. Harapannya, kita akan membangun silaturrahmi yang multi aspek,\" terang dia.<br style=\"outline: none;\"><br style=\"outline: none;\">Selain itu, lanjut Chairuddin lagi, juga akan dibangun hastag \"We are PNJ\". Semangat kebersamaan dari sense of belonging terhadap PNJ, menjadi semangat guyub komunitas yang menghilangkan gap antar angkatan. Terutama antara angkatan awal dan angkatan muda, karena perbedaan usia dan karakter zamannya yang cukup jauh.<br style=\"outline: none;\"><br style=\"outline: none;\">\"Kita punya prinsip dan tujuan yang sama dengan PNJ, ingin menjadikan PNJ sebagai World Class Polytechnic. Salah satu keunggulan alumni adalah koneksi industri dan relasi yang luas, mulai dari mantan Menteri, anggota DPR RI, Komisaris BUMN, Board of Director and Management di berbagai perusahaan nasional maupun internasional, hingga mereka yang bekerja di luar negeri,\" tuturnya.<br style=\"outline: none;\"><br style=\"outline: none;\">\"Hal ini tentunya sebagai kekuatan tersendiri bagi almamater untuk meraih predikat kelas dunia, yang akan menjadi mudah dengan kolaborasi yang intens,\" harap Chairuddin menambahkan. Saat ini, Chairuddin juga menjabat sebagai General Manager PT Telkomsel Tbk.<br style=\"outline: none;\"><br style=\"outline: none;\">Crash program yang akan dilakukan dalam 100 hari kerja, sesuai misi awal, mendasarkan data dari 3000-an alumni yang sudah masuk. Semua alumni akan dihubungkan melalui connection the dot.<br style=\"outline: none;\"><br style=\"outline: none;\">\"Syukur alhamdulillah, kalau kita dapat mencapai 10 persen dari 38 ribu alumni PNJ tersebut dalam program 100 hari ini. Kalau data itu terkumpul, peluangnya jadi lebih mudah. Untuk itu, rencananya kita akan mengadakan zoom meeting masing-masing dengan 5 angkatan setiap pertemuan. Setelahnya kita akan bentuk alumni menjadi klaster-klaster, mulai dari jurusan, domisili, bisnis, hobi dan lainnya,\" ungkap Chairuddin memaparkan programnya.<br style=\"outline: none;\"><br style=\"outline: none;\">Teknologi media sosial yang tengah marak saat ini, sangat mendukung mengumpulkan data yang ribuan. Hanya dalam waktu tiga bulan sejak November saja, sudah terkumpul 3.000-an alumni.<br style=\"outline: none;\"><br style=\"outline: none;\">\"Apalagi ada aplikasi yang memungkinkan kita mengirim pesan singkat ke ribuan orang sekaligus, ditambah sekarang sudah berkolaborasi dengan data PNJ. InsyaAllah yang kita harapkan dapat tercapai,\" dukung Zahir sebagai Ketua Dewan Perwakilan Alumni Ikapunija menambahkan.<span style=\"font-size: 1rem;\"><br></span></div>', 14, 1, '2021-02-27 13:17:44', 'N', '2021-02-27 13:17:44', '2021-03-02 23:00:24');
