(6, 'PROGRAM REKRUT FRESH GRADUATE 2021', 'Raih kesempatan Belajar, Berkembang serta Berkontribusi untuk Indonesia', 'WgmB8uG6ZTzOn5o0-2021-03-03-cdc-4baf319ade4ac38ddeb08fa92d98a35b.jpg', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Conv_GothamRnd-Light; line-height: 30px; text-align: justify; color: rgb(127, 127, 127); background-color: rgba(255, 255, 255, 0.85);\">Raih kesempatan&nbsp;<b style=\"font-weight: bold;\">Belajar, Berkembang serta Berkontribusi</b>&nbsp;untuk Indonesia di salah satu BUMN terkemuka yang dinamis dan inovatif.<br>Mari bergabung bersama milenial Telkom Indonesia untuk berkarya, membangun Indonesia!.<br></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Conv_GothamRnd-Light; line-height: 30px; text-align: justify; color: rgb(127, 127, 127); background-color: rgba(255, 255, 255, 0.85);\">Persyaratan:</p><ol style=\"margin-bottom: 10px; color: rgb(127, 127, 127); font-family: Conv_GothamRnd-Book; background-color: rgba(255, 255, 255, 0.85);\"><li>Warga Negara Indonesia;</li><li>Telah menyelesaikan masa studi dengan melampirkan Ijazah atau Surat Keterangan Lulus (SKL);</li><li>Batas usia per 1 Maret 2021:<ol type=\"a\"><li>Fresh Graduate<br>S1: belum berusia 24 tahun<br>S2: belum berusia 27 tahun</li><li>Experience (memiliki pengalaman kerja minimal 2 tahun)<br>S1: belum berusia 27 tahun<br>S2: belum berusia 30 tahun</li></ol></li><li>Bersedia menjalani masa ikatan dinas;</li><li>Bersedia ditempatkan di lokasi penempatan pilihan dengan batasan pergerakan karir hingga Band Posisi IV masih berada dalam lokasi penempatan yang sama, sedangkan pergerakan karir ke Band Posisi III sampai dengan Band Posisi I dapat dilakukan dalam skala nasional (first/entry level adalah Band Posisi VI)</li></ol><ol style=\"margin-bottom: 10px; color: rgb(127, 127, 127); font-family: Conv_GothamRnd-Book; background-color: rgba(255, 255, 255, 0.85);\"></ol><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Conv_GothamRnd-Light; line-height: 30px; text-align: justify; color: rgb(127, 127, 127); background-color: rgba(255, 255, 255, 0.85);\"><strong style=\"font-weight: bold;\">Hanya pelamar yang memenuhi kualifikasi yang akan diproses</strong></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Conv_GothamRnd-Light; line-height: 30px; text-align: justify; color: rgb(127, 127, 127); background-color: rgba(255, 255, 255, 0.85);\"><strong style=\"font-weight: bold;\"><br></strong></p>', 'https://rekrutmen.telkom.co.id/index.php?r=site/detailjob&id=kEENG0GPTqKsROSyE6tdwPoiv8CzXMEeYtxqgWvJro4', 1, 1, '2021-02-22', '2021-03-05', '2021-03-03 14:07:56', 'Y', '2021-03-03 14:07:56', '2021-03-03 14:09:33'),
(7, 'Artikel ini telah tayang di Kompas.com dengan ju', 'Artikel ini telah tayang di Kompas.com dengan judul \"Lowongan Kerja BUMN Telkom Indonesia bagi Fresh Graduate Masih Dibuka\", Klik untuk baca: https://www.kompas.com/edu/read/2021/03/05/085856971/lowongan-kerja-bumn-telkom-indonesia-bagi-fresh-graduate-masih-dibuka?page=all. Penulis : Albertus Adit', 'fNPfkYJRxFNReED0-2021-03-06-cdc-d5cafa4b45dae488b170723d5200f239.jpg', '<p><span style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\">Artikel ini telah tayang di&nbsp;</span><a href=\"https://www.kompas.com/\" style=\"color: inherit; vertical-align: baseline; outline: 0px; transition: all 0.2s ease 0s; font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Kompas.com</a><span style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\">&nbsp;dengan judul \"Lowongan Kerja BUMN Telkom Indonesia bagi Fresh Graduate Masih Dibuka\", Klik untuk baca:&nbsp;</span><a href=\"https://www.kompas.com/edu/read/2021/03/05/085856971/lowongan-kerja-bumn-telkom-indonesia-bagi-fresh-graduate-masih-dibuka?page=all\" style=\"color: inherit; vertical-align: baseline; outline: 0px; transition: all 0.2s ease 0s; font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">https://www.kompas.com/edu/read/2021/03/05/085856971/lowongan-kerja-bumn-telkom-indonesia-bagi-fresh-graduate-masih-dibuka?page=all</a><span style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\">.</span><br></p>', 'https://www.kompas.com/edu/read/2021/03/05/085856971/lowongan-kerja-bumn-telkom-indonesia-bagi-fresh-graduate-masih-dibuka?page=all', 1, 1, '2021-03-05', '2021-03-12', '2021-03-06 01:22:32', 'Y', '2021-03-06 01:22:32', '2021-03-06 01:22:32');
