(4, 'RAPAT UMUM ANGGOTA IKAPUNIJA', 'Jakarta - Setelah dilakukannya kegiatan Debat Kandidat dan Penyampaian Visi Misi Calon Ketua Ikapunija dan Calon Anggota DPA. (13/2)', '', '<p align=\"justify\">Jakarta - Setelah dilakukannya kegiatan Debat Kandidat dan Penyampaian Visi Misi Calon Ketua Ikapunija dan Calon Anggota DPA. (13/2)</p><p align=\"justify\">Agenda yang akan dilakukan dalam rangkaian regenerasi Ikapunija selanjutnya yakni&nbsp; Rapat Umum Anggota Ikapunija, dimana akan ada proses pemilihan dan pelantikan Ketua Ikapunija serta Anggota Dewan Perwakilan Alumni (DPA).</p><p align=\"justify\">Agenda Rapat Umum Anggota Ikapunija diagendakan pada hari Sabtu, 20 Februari 2021 bertempat di Aula Gedung Direktorat Politeknik Negeri Jakarta dan dapat disaksikan melalui kanal Youtube Ikapunija. (Kontributor)<br></p>', 8, 1, '2021-02-18 09:55:03', 'N', '2021-02-18 09:55:03', '2021-02-27 13:19:09'),
