(6, 'Struktur Organisasi KOPTEK', 'Dengan ini kami infokan struktur organisasi yang baru untuk KOPTEK.', 'KXYgMv3ci8ghnVlW-2021-03-03-pengumuman-0eeb96ec8934df2cffb6aea4c905d5c8.jpg', '<p>Assalamu\'alaikum Wr. Wb.</p><p>Selamat pagi, salam sejahtera bagi kita semua.</p><p><br></p><p>Pengurus dan Pengawas memberikan penghargaan setinggi-tingginya serta terima kasih kepada Seluruh Anggota dalam rangka Rapat di tanggal 27 Februaru 2021 lalu yang berjalan dengan baik.</p><p><br></p><p>Alhamdulillah, puji syukur kepada Allah SWT, formasi kepengurusan KOPTEK telah terisi lengkap sebagai upaya menjalankan program kerja nyata.</p><p><br></p><p>Kami mengharapkan agar seluruh Anggota dapat berpartisipasi dan berperan aktif memberikan saran dan kontribusi demi kemajuan serta keberhasilan KOPTEK kedepan, sehingga jalinan sinergi dan kolaborasi dapat terwujud.</p><p><br></p><p>Wassalamu\'alaikum Wr. Wb.</p>', 8, 1, '2021-03-02 13:34:12', 'Y', '2021-03-02 13:34:12', '2021-03-03 12:20:01'),
(7, 'Bang Coy (Ketua IKAPUNIJA)', 'Connecting The Dot by Bang Coy', 'rlbRMaTNYP2FkLzq-2021-03-03-pengumuman-3b456afdd19137b6ac41ce7f52ceeb79.jpg', '<p>Siapa aja Ketua IKAPUNIJA yang sekarang? Yuk kita cari tau lewat video berikut ini.</p><p>Saksikan video selengkapnya melalui channel youtube kami di link berikut ini&nbsp;<a href=\"https://youtu.be/t9Jqr3hlBWo\" target=\"_blank\">Bang Coy</a>. Jangan lupa like dan subscribe ya :)</p>', 16, 2, '2021-03-03 12:11:20', 'Y', '2021-03-03 12:11:20', '2021-03-03 12:18:05'),
(8, 'PNJ Alumni Association', 'Video PNJ Alumni Association dari para Alumni PNJ', '0OYxtKaQXFpfNorA-2021-03-03-pengumuman-a98ca3b03a9711c0ef3b421c96373791.jpg', '<p>Siapa aja sih orang-orang keren diantara para alumni PNJ? Yuk kita lihat video berikut ini. </p><p>Saksikan video selengkapnya melalui channel youtube kami di link berikut ini <a href=\"https://youtu.be/R8Q4C5sUrYQ\" target=\"_blank\">PNJ Alumni Association</a>. Jangan lupa like dan subscribe ya :)</p>', 16, 1, '2021-03-03 12:14:38', 'Y', '2021-03-03 12:14:38', '2021-03-03 12:19:31'),
(9, 'Penyerahan Kenang-Kenangan Buku dari Choiruddin', 'Saat Penyerahan Kenang-Kenangan Buku dari Choiruddin (Ketua Ikapunija) 3 Maret 2021', 'yI2RbfvfAtxbBq4h-2021-03-06-pengumuman-bc7fab56365a4c413d2d989f66dab0e5.jpg', '<p>Penyerahan kenang-kenangan buku dari Choiruddin (Ketua Ikapunija) 3 Maret 2021 di Gedung Q PNJ<br></p>', 8, 1, '2021-03-06 01:19:18', 'Y', '2021-03-06 01:19:18', '2021-03-06 01:19:18');
